/*Table structure for table `tb_manager_log_login` */

DROP TABLE IF EXISTS `tb_manager_log_login`;

CREATE TABLE `tb_manager_log_login` (
  `log_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '流水号',
  `log_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '登录时间',
  `log_ip` varchar(64) NOT NULL COMMENT '登录IP',
  `log_type` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '日志类型',
  `log_manId` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `log_input_username` varchar(64) DEFAULT NULL COMMENT '帐号',
  `log_input_password` varchar(64) DEFAULT NULL COMMENT '密码',
  `log_input_captcha` varchar(64) DEFAULT NULL COMMENT '验证码',
  PRIMARY KEY (`log_id`),
  KEY `Time_Ip_Type` (`log_time`,`log_ip`,`log_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='管理员登录日志';

