insert  into `tb_website_apply_register_intro`(`register_id`,`website_intro`) values (1,'菲律宾南洋天地宫坐落于奎松市，平时有华人华侨诚心祭拜，并有风水服务。风水是通过环境和气场的改变助你一生吉祥好运。\r\n预测不是坐等事情的发生，而是更好的规划未来。'),(2,'菲龙网建于2013年7月15，菲龙网是目前管理得最完善的菲律宾华人论坛，菲龙网的目标是成为菲律宾最具影响力的华文媒体。 \r\n\r\n菲龙网的内容板块有本地新闻、时事评论、财经新闻、华人世界、美食专题、旅游专题、娱乐场所、爱车一族、亲子乐园、电子科技、时尚潮流、体育交流、新手报到、会员照片、菲华好歌声、情感日志、摄影爱好、语言交流、商品买卖、房屋交易、生活服务、招聘求职等。'),(3,'万博娱乐城是菲律宾最大赌场酒店&quot;凯悦赌场&quot;旗下全球知名网络博彩网站。2006年公司获得菲律宾FCLRC颁发体育博彩及互动博彩游戏执照,能从事包括Financial Betting、live casino、proxy betting、sports book等在内的所有互联网博彩项目（FULL LICENSE)。公司所有产品及服务均接受菲律宾卡格扬经济特区（CEZA, Cagayan Special Economic Zone Authority）和第一卡格扬 (FCLRC, First Cagayan leisure and Resort Corporation)的管辖。我们所使用的软件，都经过了TST（Technical Systems Testing）的安全测试，保证软件的任何环节都没有问题，并且派彩公平公正。 \r\n\r\n万博88娱乐城母公司凯悦赌场酒店(Hyatt Hotel and Casino)是马尼拉湾的豪华地标,位于马尼拉的商业与购物区,至马卡蒂(Makati)金融商业区约30分钟车程。 马尼拉2005年新落成的凯悦赌场酒店(Hyatt Hotel and Casino)颇受瞩目，富丽堂皇，尤其是内部的赌场﹐各国游客都趋之若骛。而内部的赌场，号称是境内饭店赌场规模最大者，123张赌桌以及30种、626架游戏机。 \r\n\r\n万博88娱乐城凭借&quot;Hyatt Hotel And Casino Manila凯悦赌场&quot;雄厚的资金实力以及高素质的专业人才和优质高效的客户服务以在业界树立良好的企业形象。公司在创新服务，技术开拓、安全维护等方面进行了重点投入，并不断开发新的业务品种、推出多元化的配套服务，打造最优质的在线博彩娱乐互动平台。 \r\n\r\n公司运营总部设于菲律宾卡格扬经济特区（CEZA, Cagayan Special Economic Zone Authority）。目前，设有销售部、技术部、行政人事部、财务部、法律部等部门和产品服务、代理推广两个主营业务部门以及技术开发中心、发展研究中心、网络安全维护中心三个综合部门。'),(4,'菲律宾华教中心于1991年5月24日成立，菲律宾华教中心是一个服务于菲律宾全国从事华文教育和汉语教学单位的学术研究和行政协调机构，菲律宾华教中心宗旨是发展菲律宾华社的华文教育和主流社会的汉语教学。作为菲律宾一个专业民间组织，菲律宾华教中心与菲律宾政府机关，如教育部、高等教育委员会、外交部、移民局等，建立比较密切的协作关系，共同为推动菲律宾华社的华文教育和主流社会的汉语教学而积极工作。 \r\n\r\n菲律宾华教中心由“老华人”倡捐，侨中学院董事、校友以及许先生、各旅菲校友会、进步党总部洎各支部、新联公会和热心社会人士等捐资设立基金，开展工作。陈清楠老先生纪念教育基金、李淡先生纪念基金、庄中蔚曾真真教育基金、蔡国明教育基金、施雨良教育基金、蔡建华教育基金、施灿悦教育纪念基金各以100万比索为基金,支持中心。佘明培先生纪念基金会、李国箴许美真伉俪基金会、爱心文教基金会、丁德仁等每年拨款捐献中心，积极支持中心的工作。 \r\n\r\n菲律宾华教中心办公室负责开展各项具体工作，下设资讯部、出版部、师资部、交流部、考试部等专业功能的部门，由专人负责其业务。1992年4月20日，成立正式立案的全国性华语教师组织——菲律宾华语教师协会，作为附属机构，开展有关华语教师业务、福利、联谊的工作和活动。2003年10月底起，成立四个正式立案的地区性华文教育组织——大马尼拉华教协会、吕宋华教协会、米沙鄢华教协会、棉兰老华教协会，覆盖全菲律宾，会员学校共114所。下属的四个华教协会，在中心的统一协调下，在本地区推动华语第二语言教学，提高华语教学质量。 \r\n\r\n菲律宾华教中心立足菲律宾，面向世界，与五大洲33个国家和地区的有关单位和人士建立联系，开展各种方式的交流活动。特别是与中国的教育部、文化部、新闻出版总署、汉办、侨办、中国华文教育基金会以及地方教育部门、大专院校、幼儿园，交流密切，合作广泛。2002年12月，在中国北京设立驻北京办事处，负责办理在华的有关事务。 \r\n\r\n菲律宾华教中心扎实的工作，得到社会的普遍肯定和重视。中国大使馆、商总、晋总、和统会、校友联、陈延奎基金会、宿务无名氏（引叔）、爱心文教基金会、李国箴许美真伉俪基金会等长期委托协助办理一系列培训、评选、奖学的活动。'),(5,'中华人民共和国驻拉瓦格领事馆是继中国驻菲律宾大使馆和驻宿务总领事馆后，中国在菲设立的第三处政府代表机构。领区包括菲律宾第一地区、第二地区和科迪勒拉行政区，共计15个省，面积近6万平方公里。 \r\n\r\n　　近年来，随着中菲两国关系的不断发展，拉瓦格领区和中国国内相关省市在经贸、人员和文化等领域的交流与合作不断扩大。我们愿借助网络这一平台，及时向您介绍中国，帮助您了解中菲关系、领馆信息、申办中国签证须知及领事保护和服务指南等。'),(6,'中华人民共和国驻菲律宾共和国大使馆致力于推动中菲关系健康、平稳发展，致力于增进两国人民的相互了解和交流合作，致力于为海外华侨、华人、中资机构和留学生提供便捷、高效的领事服务。 \r\n\r\n中国驻菲律宾共和国大使馆地址: \r\n\r\n1235 Acacia Street, \r\nDasmarinas Village, \r\nMakati City, \r\nMetro Manila, \r\nRepublic of the Philippines ( Front Gate). \r\n\r\n4896 Pasay Road, \r\nDasmarinas Village, \r\nMakati City, \r\nMetro Manila, \r\nRepublic of the Philippines (Rear Gate). \r\n\r\n总机 0063-2-8443148，接线员分机101'),(7,'菲华商联总会是由一群关心社会公益事业的商界领袖，於一九五四年创立，目前本会已经发展成為本国主要商业团体之一。 \r\n\r\n菲华商联总会除了向其会员单位的需要提供服务之外，也在促进本国经济和社会发展方面，起着巨大作用。 \r\n\r\n本会的各项主张和方案，均反映在政府的经济政策上。我们从事各种民事工作，支援各项人道主义事业，参与各项文化活动，并以各种方式援助菲青少年教育事业。我们继续促进菲华社会的和谐团结。今天，本会在全国各地已经拥有一百七十个会员单位，每一个会员单位均从事各项响应社会需求的方案和活动。我们与社会各领域一起合作，共同实现国家进步和全民富足。 \r\n\r\n亚谨诺总统阁下在本会第廿八次全菲代表大会上，表彰本会為本国工商业和国家发展的支柱，同时期盼本会能够继续成為建设一个更加理想国家的支柱。中华人民共和国驻菲特命全权大使刘建超阁下在代大致词中同样讚扬本会為发展菲华社会的支柱，為促进菲中友谊的支柱。 \r\n\r\n菲华商联总会能获菲中两政府的信任，激励我们為国家社会做更多事，坚持不懈地推行我们的各项方案，為国家建设作出贡献。我们愿与政府当局及社会各界携手合作，加强实现国家繁荣昌盛的伙伴关係。'),(8,'菲华网是服务于菲律宾华人的中文网站。菲华网的内容板块有菲律宾新闻、财经新闻、华人世界、家园、写日记、发心情、传相册、分享瞬间、房产、交友、菲律宾留学、菲律宾旅游等。'),(9,'菲律宾免费的商信息收发平台,菲律宾最专业的中国商品集散地\r\n打造菲律宾最专业的电子商务市场，为在菲经商的商家提供一个免费的商业信息交流平台，我们提供了一个先进的网络展厅，可有效的减轻商家的库存压力，减少商家的推销成本。\r\n网站还为在菲居住的华人提供了一个便捷的社区生活交流平台'),(10,'菲律宾商报是菲律宾歷史最悠久的华文报刊，创刊於1919年。菲律宾商报提供菲律宾华人社会及国内外新闻及评论，為菲律宾较有权威性华文报刊。网站的内容板块有菲国、华人、国际、经济、投资、中国、侨务、留学、旅游等。'),(11,'澳门贝尔教师校园为世界各地教师提供专业发展、语言文化交流的独特机会，自从2009年以来,全球共有2,500多名教师受益于该项目在英国剑桥校园举行的教师培训活动。 \r\n\r\n如今，被公认为澳门本土及东南亚地区优质英语教育培训中心的澳门理工学院理工-贝尔英语中心与贝尔教育服务携手合作，把该项目介绍到澳门来，将在2013年7月于澳门理工学院举行第一届（澳门）贝尔教师校园，该项目为一或两个星期的住宿式教师培训活动。 \r\n\r\n（澳门）贝尔教师校园将提供一系列涵盖教师专业培训的课程，内容丰富多彩，每个上午有三小时的选修课程，下午有专业工作坊，晚上还有澳门文化考察活动。课程设置精彩独特，与其说是教师的专业培训课程，倒不如说是生动有趣的课程研讨会；课程集先进专业教学知识、创意活动教学以及多姿多彩的课外活动于一体。 \r\n\r\n老师们，欢迎您们一起加入（澳门）贝尔教师校园，参与这独一无二的培训活动，见识那与别不同的神奇澳门，留下您们终生难忘的珍贵记忆！'),(12,'澳门皇家商标服务专营各地商标註册，熟悉各地商标註册及商标查询手续流程。\r\n皇家商标业务团队覆盖中、港、澳、台，凭藉多年经验及团队的优势，重点处理中国商标、香港商标、澳门商标及台湾商标四大地区。為你介绍商标註册流程及申请商标费用。'),(13,'迪拜中文网 - 迪拜华人互帮网以翻译英文版阿联酋迪拜新闻，迪拜留学，经济贸易，法律法规为主。\r\n阿联酋迪拜华人互帮，商业广告互动交流为辅。'),(14,'越南中文网提供实时越南新闻、越南旅游攻略、越南新娘动态、越南特产批发、以及打造最好的互动越南论坛。'),(15,'越南展览网专业业从事操作中国-越南两国之间展览和会议组织与服务、越南市场商务考察、市场调研、投资咨询、贸易促进服务等多项业务于一体。与越南相关政府和贸促机构、会展公司、行业协会、企业界国合作密切；同时也得到了越南工贸部贸促局、越南工商联合会、越南驻华大使馆的大力协助。 \r\n\r\n架设中越企业合作互动的桥梁，成为中国企业进入越南市场最资深的向导。我们在越南首都河内和越南最大商业城市胡志明市设有分支机构，在承办和协办各种越南会展和商务活动等方面具有独到的专业优势。 \r\n\r\n每年在越南操作约40个各类会展和商务活动项目，为中国企业高效、低成本拓展越南市场做出了极大的贡献。 我们常年在越南协办展会和承办各类商务促进活动的部分项目：越南国际贸易博览会、越南国际造船工业及海运展览会、越南国际工业产品展览会、越南国际能源产业博览会、越南国际食品饮料工业博览会、越南水产交易会、越南国际环保技术展览会、越南国际建筑装饰博览会、越南国际农业博览会、越南国际汽车及零配件展览会、中国产品（越南）交易会、中国纺织面料辅料出口越南采购对接会、中国教育器材出口越南采购对接会、中国鞋材出口越南采购对接会、中国-越南水泥行业投资、设备应用及新技术新材料交流推介会、中国进口越南水产品采购会 ……等约40个展览及商务会议项目。'),(16,'印尼华人论坛是面向印度尼西亚华人的一个不牟利的组织\r\n目前印尼华人论坛最大的看客来自中国（中国、香港、台湾和澳门）以及东南亚（印尼、马来西亚和新加坡）。'),(17,'千岛日报创刊于2000年10月10日。其办报的宗旨是：争取和维护华人正当权益，促进各族和谐共处，共创国家社会的繁荣。报纸刊头上以“千岛安祥，人民幸福”八字涵盖此宗旨。 \r\n\r\n自2008年5月份起，《千岛日报》周一至周六每天出版四大张（间或增版），共16版：第一版：国际、国内重大新闻；第二版：国内次要新闻：第三版：泗水与地区新闻版；第四版：华社动态版；第五版：经济新闻；第六版：医药保健；第七版：副刊版；第八版：文娱、体育版。 \r\n\r\n此外，“两岸四地”、“台湾信息”、“国际新闻”，以及广东老报人每月为我报编纂《中华文化》、《天南地北》、《家庭彩色版》、《童心》各两版；中国新闻社也按期为《千岛日报》代编“天下华人”、“健康养生”、“中国影片”、“新闻追踪”、“古今轶事”、“两岸焦点”、“华文园地”等，广东海外交流协会每月为我报编纂一期“侨乡广东”，这些都按期安排在第9至16版栏目内。 \r\n\r\n《千岛日报》销行印尼全国，以印尼东部地区为主，并有寄至港、澳、中国大陆等地。服务对象是广大印尼华人读者。为目前印尼国内销行量较多、销行地区较广泛、影响面较大的华文报刊之一。香港凤凰台杨锦麟先生主持的《有报天天读》栏目，不时介绍《千岛日报》重大新闻标题和主笔莫非、南山仔的“时评”撰文，足见《千岛日报》的分量。'),(18,'印度华人论坛旨在为华人提供一个了解中国和印度的社区交流平台，包含印度留学，印度签证，印度旅游，印度外贸，印度生活，印度文化，中印贸易，印度商务，二手买卖，招聘求职等多个栏目板块，力图打造成最专业的印度华人社区。'),(19,'《社区网》是与《社区报》互动的中文网网站\r\n加拿大社区网主要为华人社区与个人服务，提供衣食住行方面的实用、全面信息，提出“源自社区，服务社区”新概念，打造加拿大华人社区最有效门户网页！'),(20,'十多年前，星云大师法驾温哥华弘法，对於本地居民的真诚和善，留下极為深刻的印象。大师以為，在这块灵毓的大地上，若能有佛光照耀，法音宣流，必将更為相得益彭，以是之故，在种种妙因善缘的和合下，於1991年先后创立温哥华佛光会，温哥华佛光山。 \r\n\r\n国际佛光会的成立，是為了体现同体共生及欢喜融个的人间佛教神。这多年来，佛陀的慈悲教化，渐渐在这美丽的加拿大温哥华，开花结果。 \r\n\r\n温哥华乃加拿大之西岸重镇，不论是都市发展的先进抑或风景气候的怡人，都风闻宇内，是以，本地向為移民的天堂，尤以移民的华人年年遽增。本坩地华人在离乡背井之后，更是渴望在心灵上有所依靠。 \r\n\r\n温哥华佛光山佔地三万平方公尺，座位於列治文市8181 Cambie Road 六楼。主要设备有：如来殿、佛光缘书局、滴水坊、教室、图书馆、办公处、及五观堂。 \r\n\r\n温哥华佛光山开放时间為每日早上九时至下午六时。週日法会由早上十时开始。温哥华佛光会定期举办各种佛学讲座、专题演讲、让参与者明橑佛陀的本怀，增长智慧，扩大见闻，进而发心学习。 \r\n\r\n佛法在人间 人间是佛法 \r\n佛光山自开山以来，在短短三十年间，已拥有百餘所别分院，遍佈世界五大洲，让不同种族的人，得以获得佛法的滋润，并带来更吉祥和乐的人生。 \r\n\r\n教育弘法 -将菩提种子撒满世界各角落 \r\n為了替佛教注入新血，佛光山在教育弘法方面开啟多所佛学院，大学及图书馆，并主办各项佛学夏令营、佛学讲习会、儿童班。 \r\n\r\n欢迎大众亲临佛光山，或上网（www.vanibps.org)，或上FB Page ＂Vancouver Fo Guang Shan 温哥华佛光山＂资询。'),(21,'纽约华人网是服务于纽约地区华人的门户网站。纽约华人网站主要频道包括纽约新闻、美国新闻、大陆新闻、台湾新闻、香港新闻和国际新闻等频道，以及纽约地区生活信息服务频道，包括房屋信息、工作请人和汽车买卖等生活便民信息。'),(22,'委国华人网是委内瑞拉第一华人网，也是拉美最大的海外华人网，组建于2006年8月8号，经过多年多的风雨兼程，现会员有两万多，原创和转载大量本地新闻，并设立了华人论坛（委华论坛）、分类广告网、在线电视等特别栏目。委国华人网从最初的简单论坛已经发展成为委国华人交流、娱乐、互助的综合信息交流和服务平台。 \r\n\r\n委国华人网的使命和宗旨，以侨为本，利用网络为中心搭建一条友情.亲情.乡情.民族情之桥，以崭新的专业知识和新闻手法，给委国华人提供一个优秀的服务窗口。 \r\n\r\n委国华人网将会不定期举办各种活动，为委内瑞拉各个领域的华人朋友提供更好的交流机会。 \r\n\r\n在今后的发展过程中，委国华人网将围绕本站的宗旨，不断完善自我、超越自我；委国华人网将继续努力创造温馨的环境 ，以热忱的心欢迎更多朋友加入；委国华人网将尽量满足每一位侨胞的需要，为支持网站发展的朋友们提供更好的服务，让其成为我们心灵的港湾。 \r\n\r\n无论天涯海角，无论相隔万里，我们始终血脉相连，生生不息，共创华人的另一片家园。'),(23,'荷兰台湾商会於1993年9月8日成立，原名為荷兰台湾工商联谊会，於1995年1月10日更名為荷兰台湾商会。荷兰台湾商会成立目的在举办联谊活动、提供经营资讯、寻找经贸机会、促进有效管理。荷兰台湾商会係秉持世界台湾商会联合总会之成立宗旨 ，以促进在荷兰台商团结互助 ，荷兰台湾商会支持中国策 ，增进中荷两国之友谊与繁荣 ，為宗旨之非营利团体。'),(24,'新西兰中文网是新西兰大型的中文门户网站。从2001创办以来新西兰中文网一直以服务广大华人为宗旨，是华社与各界交流的重要平台。 \r\n\r\n新西兰中文网一直不断积极创新和发展，开发了政治话题、社会新闻、财经论点、体育新闻、娱乐八卦、生活资讯等众多自由论坛，眾多华社知名主笔都在新西兰中文网的论坛中开设有个人专栏，发展至今新西兰中文网已经成为了新西兰最为重要的华人资讯空间，在华社中占有极为重要的地位。 \r\n\r\n本地各大政党视新西兰中文网为重要时政新闻和政策宣示的发佈窗口，众多时政评论人士也视本网为华社舆论空间中的一个制高点，使得本网极具舆论导向功用。因广大华人对新西兰中文网重要地位的认可，加之居高不下的浏览人数，使得新西兰中文网在Google(谷歌)，Baidu(百度)，Yahoo(雅虎)等众多搜索引擎中长年以来一直居于新西兰方面中文资料首位显示。因此，在新西兰中文网发布的消息、新闻、广告等信息，在各个搜索引擎中也领先于其它同类网站，首先被阅读者所关注。 \r\n\r\n新西兰主流华人消费群体对新西兰中文网的热爱与支持，也给新西兰中文网的广告商家们带来了庞大的商机。我们拥有许多长年广告商的支持; 除外，各大党派对我们的广告位置也非常看重。 \r\n\r\n新西兰中文网并不满足于过去的成就，正在不断地进行拓展、改革、充实和提升，尽力配合且满足更广大的访客需求。从2005年8月份开始，新西兰中文网已经从私人化管理模式逐渐转换为正规的企业经营模式。 \r\n\r\n新西兰中文网本身的品牌和影响力，与广告商家的品牌和信誉相结合，将创造出一个美好的多赢局面。'),(25,'非洲中文网是报道非洲国家，非洲政治，非洲经济，非洲社会，非洲新闻，介绍非洲风光，非洲风俗，非洲地图，非洲购物，非洲文化,非洲贸易，非洲投资,非洲旅游概况，网聚非洲华人，分享非洲经验，探讨非洲创业, 讲述非洲故事,打造走进非洲的桥梁,了解非洲的窗口，服务非洲华人的综合门户网站。'),(26,'智利华人在线网是关于智利华人生活、文化、旅游、杂志的内容网站，智利华人在线网致力于为智利华人服务，让华人更了解智利，与智利共同发展。 \r\n智利华人在线是一个由在智利生活华人华侨自发创办的网站，网站主要反映在智利生活的华人华侨的生活和工作状态，同时也反映了华人对智利当地文化的理解。智利华人在线网是为想了解智利、生活在智利的华人量身定制的生活、文化、旅游信息综合网网站，深入智利衣食住用行、吃喝玩乐学的各个方面，为华人提供全方位的本地信息及日常所需的各种便利。网站通过网络服务及各种形式的线上线下活动，保持与华人社区及社会团体的亲密联系，为本地华人、海外学生及访智游客提供全方位的服务，同时为各类别商户及合作伙伴搭建拓展本地市场的免费广告平台。'),(27,'根廷华人在线网是阿根廷中文资讯门户网站。\r\n阿根廷华人在线的内容有新闻资讯、生活指南、分类广告、招聘、服务黄页、博客、论坛、实用链接、搜索、心灵之窗等。阿根廷华人在线为开放性社区网站，服务于阿根廷及南美的华人华侨。阿根廷华人在线网立足阿根廷，服务南美洲华人社区'),(28,'亚省华人网是一个服务于亚利桑那州华人社区的电子网络。亚利桑那华人网涵盖了亚省的新闻、国际资讯以及中国的时事报道，同时还提供各类生活服务信息。亚省华人网向亚省华人社区提供一个交流信息的平台： \r\n\r\n每周的亚省华人网络通讯 \r\n及时的社区新闻和国际新闻 \r\n亚省华人网上论坛 \r\n亚省地区的招工及求职广告 \r\n亚省地区的各种商业目录（移民，会计，餐馆，杂货，等等） \r\n亚利桑那华人网的宗旨是：“服务社区，增加交流”'),(29,'纽约论坛始办于2009年9月1日，是致力于提供生活资讯、消费购物、人际交流一体化服务的美国纽约本地大型华人互动平台。 \r\n\r\n纽约论坛定位于美国纽约的生活消费社区.打造(真实.丰富.愉悦)的网上家园。纽约论坛作为本地最具成长性的生活消费分享的平台，是纽约地区最具影响力的网络服务品牌之一，为600多万美国华人提供生活交流、消费分享、购物指导等实用服务，通过纽约论坛 (nybbs.com) 让用户快乐追求更高质量高效率的生活。 \r\n\r\n纽约论坛通过对生活，购物，消费的分享，希望用户广泛参与进来的同时，认识更多的朋友，拓展自己的交际.通过分享吃喝玩乐，衣食住行，购物消费，交友婚恋等生活中各方面的内容，纽约论坛 (nybbs.com) 汇聚了一帮热爱生活，热情直爽，互助友爱的高端用户，我们的团队会更有信心一直热情的走下去…… \r\n\r\n纽约论坛 的用户群体以18-45岁社会高知主流人群为主，心态以积极向上，热情友爱，爱心互助，有梦想，有追求的朋友为。来到纽约论坛 (nybbs.com)不仅仅是电脑显示器前看到的一个网站，而是借助这个平台，让用户的生活有更多的延展.纽约论坛 (nybbs.com) 就像您的一位老朋友，在浮华烦躁的社会以外，带来一种温暖，一种心灵的归宿，一种贴切的感受! \r\n\r\n纽约论坛 - 美国华人的中文论坛，包括人在纽约、灌水杂谈、汽车频道、美食厨房、摄影部落、影视欣赏、贴图专区、留学移民、旅游频道、环球新闻、投资理财、宠物生活、新人报道、宠物之家、妈咪宝贝、电脑数码、音乐视频、时尚女人、海外情感、学习交流、奇闻趣事、创业专栏、网络代购及论坛办公。'),(30,'华人工商网是洛杉磯华人商家分类指南。华人工商网包括华人美食、租房、律师、医生、会计师等，提供最完整的洛杉磯华人商圈讯息。华人工商网立即性的情报资讯，衣食住行任您搜索，是新老移民不可或缺的生活百科。 \r\n\r\n秉持著『整合亚裔、强化经济、创造商机』理念，华人工商网不断求新求变，以期增加读者视觉及知性生活上的享受。平面的华人工商电话簿(Chinese Consumer Yellow Pages) 和加州彩页网路资讯电话簿 (California Yellow Pages) 具有消费指南及生活字典双重功能，突显商家品牌形象，陈述多元服务内容，除了加强商家和消费者之间的互动关係外，也提供图文并茂、丰富实用的多方位生活资讯，让翻阅电话簿成為新移民拓展视野、学习新知的利器。'),(31,'熊猫快餐（Panda Express）是美国的一家经营美国化中式快餐的连锁餐厅，熊猫快餐主要运营于大型购物中心、超市和商业街中，供应多种食品，如橙子鸡、东方鸡，配以炒米饭或炒面。熊猫快餐总部设于加州洛杉矶的罗斯密市。'),(32,'檀香山唐人街位于美国夏威夷州檀香山市，为该市主要华人聚居区，是美国最早的唐人街之一，也是孙中山先生最早策划反清革命的地方。据考证，最早到达夏威夷的中国人是两艘英国探险船上的中国船员，于1788年抵达火奴鲁鲁港，但最早的中国移民是在1852年才到达的。 \r\n\r\n唐人街位于檀香山金融区西面，古老的建筑里设有各种商店、草药铺、花环店、古董店、寺庙、酒吧和餐馆。夏威夷的中国城，曾经算是中国人在海外最大的一个“Chinatown”。中国人到夏威夷要比美国人来得更早，在1779就有中国人前来开发与从事农场工作了。在1852年到1882年中，中国人前后就有将近5万人前来打工。当时的中国城是世界上最大的一个中国城。由于中国城的建筑都是木机构的，而且都是相连着，在1900年的由于一场大火，不仅把中国城彻底烧毁了，还把火奴鲁鲁城市烧毁了一半多。重新建造之后中国城，其规模也小了许多，只相当于过去规模的四分之一。 \r\n\r\n每年，檀香山为数众多的华人社团均会在此举行规模不等的商业化活动，如水仙花、春节、中秋节等。在每年的春节、中秋节等传统节日期间亦会有舞龙舞狮与隆重的庆祝游行。'),(33,'法国陈氏传媒创建于2001年8月，以促进欧亚影视电视节目的双向交流为宗旨，是欧洲最大的华人企业——法国陈氏兄弟集团旗下的全资子公司。\r\n发展至今，公司以每年向中国输送近千小时影视电视节目的业绩为公认为欧洲与中国进行影视电视节目双向交流的最大机构。'),(34,'“南非365”网站：为所有在南非辛勤打拼的华人同胞们加油！ \r\n\r\n南非365-华人信息网是位于南非约翰内斯堡的当地华人信息网站，创建于2012年11月，由南非易联网络公司投资创办。南非365网站的建设开通，旨在为您提供一个交流互助的南非本地中文平台，帮助您打开南非华人社区的大门，为您排疑解惑。借助大家的力量，在南非更方便的生活和工作，最终顺利开创自己的事业。 \r\n\r\n目前南非365网站已经设有新闻实事、人在南非、南非法规、美食和健康以及房屋租售、招聘应征、便民服务等等的版块和栏目。网站自开通以来，由于信息批露及时、准确，成为了很多网友心目中的首选网站，并得到了侨界多家侨团和商会以及机构的认可，纷纷在我们网站开通了官方博客，以便在第一时间向在南非的华人同胞们提供他们的咨讯和服务。 \r\n\r\n在得到客户的充分肯定后，南非365网站又重拳出击推出全南非第一个中文微信公共平台（微信号：nanfei365）并立刻又得到年轻朋友的喜爱和关注。添加人数每天都成倍增长。通过南非365的微信平台（微信号：nanfei365），我们可以将最新安全信息，警民警讯，汇率行情以及娱乐资讯第一时间免费送到您的手机微信。让您不出门遍可以了解南非动态。 \r\n\r\n今年6月我们南非365网站还参与协办了“2013年水立方杯海外华裔青少年中文歌曲大赛”南非区的选拔赛，这一由南非华文教育基金会主办、南非东方商城投资集团承办的侨界盛事取得了巨大成功，选拔中的预赛和决赛过程可谓精彩纷呈，为南非侨界增添了一道亮丽。我们南非365通过门户网站以及微信平台（微信号：nanfei365）对比赛进行了多媒体全程覆盖，使大家不必再为了错过一刻的精彩而捏腕惋叹。 \r\n\r\n在南非365网站成立后的短短半年里，网站的点击率以经超过每天2万点，一跃成为南非最活跃的中文门户网站之一。事实证明，借助南非365网站，就能有效的利用互联网络来迅速的展现您自己以及您想要发布的咨询。来吧，推开网络之窗，我们将与您携手共建自已的网络家园，诚邀您加入我们！新的一片星空，新的一个梦想！'),(35,'上海优俊酒业有限公司，总部位于南非约翰内斯堡，十年来专注于南非红酒文化的研究、传承、生产、定位及推广，并致力于南非红酒品牌在华的市场代理和渠道开拓。\r\n\r\n    优俊酒业拥有专业的生产及营销团队，每一个品牌，每一款红酒都是从原料开始，经过精心挑选，严格按照传统工艺酿造。每一瓶都是百分之百原产地罐装、原瓶进口的优俊佳酿。优俊所代理的红酒品牌在欧美葡萄酒大赛中屡获大奖。并成为南非驻外使领馆的指定招待用酒。精准的市场定位和全方位的营销策略使优俊代理的红酒成为多家世界知名航空公司的头等舱用酒。\r\n\r\n    优俊酒业将以超前的经营理念把高品质的南非红酒和古老悠久的南非红酒文化引入大中华地区，与每一位热爱红酒的华人朋友分享。'),(36,'　　大　　使：高克祥\r\n\r\n　　政务参赞：李   翀\r\n\r\n　　国防武官：许晓松\r\n\r\n       经商参赞：夏晓玲\r\n\r\n　　 \r\n\r\n　　部　　门：——政治处\r\n\r\n　　　　　　　——办公室\r\n\r\n                        ——领事部\r\n\r\n　　　　　　   ——武官处\r\n\r\n　　　　　　   ——经商处\r\n\r\n　　使馆地址（本部）：\r\n\r\n　　Rua Presidente Houari Boumedienne No 196/200, Miramar, Luanda, Angola\r\n\r\n　　办公时间：周一至周五 9:00-12:30,14:30-17:00\r\n\r\n \r\n\r\n　　政治处\r\n\r\n　　主要职能：联系并落实两国领导人、政府和议会间等高层交往相关工作；处理两国政治事务相关事宜；推动两国政党、地方政府、文化、体育、青年、妇女、新闻界、学术机构、民间等各领域友好交往；办理赴华奖学金事宜；使馆对外新闻宣传和与媒体关系；使馆对外礼宾事务。  \r\n\r\n　　电话：00244-222-441683\r\n\r\n　　传真：00244-222-444185\r\n\r\n \r\n\r\n　　办公室\r\n\r\n　　主要职能：使馆内部行政事务。\r\n\r\n　　电话：00244-222-444658\r\n\r\n \r\n\r\n      领事部\r\n\r\n      主要职能：中国公民领事保护；办理赴华签证、中国人护照/旅行证、公证、认证等证件。\r\n\r\n      主任：张岩\r\n\r\n      领事保护电话：00244-222-449818\r\n\r\n                               00244-912-206764\r\n\r\n      传真：00244-222-449866\r\n\r\n      地址：Rua.Eng.Armindo Andrade 188/190, Miramar, Luanda, Angola\r\n\r\n　  办证时间：\r\n\r\n　　     收件：周二、周五（签证）                        09:00-12:00\r\n\r\n                      周三（中国人证件、公证、认证）   09:00-12:00\r\n\r\n　　     取件：周二、周五                                      15:00-17:00\r\n\r\n　　               周三                                                 09:00-12:00\r\n\r\n        \r\n\r\n　　经商处\r\n\r\n　　主要职能：促进和深化中安经贸互利合作；对安哥拉市场进行调研；协助国内企业拓展安哥拉市场，根据“信息、服务、协调、调研、交涉、保护”方针做好对中国企业的服务；为安哥拉企业开展对华合作和投资提供必要便利和服务；处理劳资纠纷事件等。\r\n\r\n　　负责人: 经商参赞夏晓玲\r\n\r\n       电话：00244-222-350481/222-351085\r\n\r\n       传真：00244-222-350980\r\n\r\n　　E-mail：ao@mofcom.gov.cn\r\n\r\n　　地址：Rua Francisco Sotto Mayor No.127, Bairro Azul, Luanda, Angola'),(37,'欢迎访问中华人民共和国驻刚果共和国大使馆网站！\r\n\r\n　　刚果共和国，简称刚果（布），位于非洲中西部，横跨赤道线，西南濒临大西洋，首都布拉柴维尔市。这里森林密布、物产丰富、民风淳朴、社会稳定，是一个风景秀美的热带国家。\r\n\r\n　　中刚两国人民有着深厚的传统友谊。1964年2月22日，中刚建立外交关系，由此揭开了两国关系新篇章。中刚建交以来，尽管国际形势风云变幻，但两国人民的友谊历久弥新，两国友好往来日渐频繁，双边合作不断深化，在政治、经贸、文化、卫生、教育等各领域开展了富有成效的合作。我相信，在中刚两国人民的共同努力下，两国友好合作关系必将得到更大的发展！\r\n\r\n　　大使馆网站是为中刚两国人民增进相互了解和提供服务的窗口。通过该网站，可以了解到刚果（布）的一些基本情况，中刚两国官方和民间交往的一些信息，以及大使馆的一些活动和服务项目。我们将不断完善网站结构，充实和更新栏目内容，同时真诚希望中外友好人士关心、支持使馆网站，不吝提出宝贵建议。\r\n\r\n \r\n\r\n \r\n\r\n　　中华人民共和国驻刚果共和国\r\n\r\n　　特命全权大使\r\n\r\n　　关键\r\n\r\n　　二〇一二年六月十八日'),(38,'欢迎您访问中国驻厄立特里亚国使馆网站。\r\n\r\n　　厄立特里亚风景秀丽、历史悠久，地处东非和非洲之角最北端，是非洲大裂谷起源之地，既有高原平川，又有海滨岛屿，更有那古老王国的遗址和多姿的意大利风格建筑。厄立特里亚矿产和海洋等资源丰富、人民勤劳勇敢，是一个有着可观发展潜力的国家。1993年中厄两国建立外交关系以来，双边关系稳步发展。近年来，在双方的共同努力下，政治、经济、文化、教育、卫生等领域的交流与合作成果丰硕、势头可喜。\r\n\r\n　　衷心希望我们的网站成为中厄两国人民加深相互了解和友谊，促进交流与合作的窗口和桥梁。\r\n\r\n       感谢您的光临。\r\n\r\n \r\n\r\n                                            牛强\r\n\r\n                                                     中华人民共和国驻厄立特里亚国大使'),(39,'欢迎光临中国驻加纳大使馆网站。\r\n加纳是最早与中国建交的撒哈拉以南非洲国家之一，两国传统友谊深厚。\r\n近年来，在中非合作论坛框架下，两国在经贸、卫生、教育等领域合作势头良好、成果丰硕。当前，中国人民正在为实现两个“一百年目标”和中华民族伟大复兴的“中国梦”而奋斗，加纳人民也在为建设“更美好加纳”而不懈努力。双方发展目标契合，定将引领中加关系开辟更加美好的未来。中方愿与加方共同努力，推进全方面合作，为传统友谊注入新的时代内涵，促进各自梦想早日实现。我非常荣幸在中加关系蓬勃发展之际出任中国第十四任驻加纳大使，恪尽职守、办好人民满意的外交是我义不容辞的责任。\r\n中国驻加纳大使馆将继续秉承“外交为民”的宗旨，竭诚为广大海外同胞服务。我希望使馆网站能成为您了解中国和加纳的窗口，成为连接中国人民与加纳人民友谊与合作的桥梁。'),(40,'大　　使： 符华强（Fu Huaqiang）  \r\n\r\n地　　址： RUE ADDIS-ABEBA,LOTISSEMENT DU HERON,DJIBOUTI \r\n　　　　　 B.P.2021,DJIBOUTI \r\n\r\n电　　话： 00253-352247 \r\n\r\n传　　真： 00253-354833 \r\n\r\n网　　址：http://dj.china-embassy.org\r\n　　　　　http://dj.chineseembassy.org \r\n\r\n电子邮箱： chinaemb_dj@mfa.gov.cn'),(41,'大　　使： 刘玉和（Liu Yuhe） \r\n\r\n地　　址： 34 BOULEVARD DES MARTYRS, ALGER \r\n\r\n国家区号： 00213-21 \r\n\r\n电　　话： 692724,692926 \r\n\r\n传　　真： 693056,693082 \r\n\r\n网　　址： http://dz.china-embassy.org\r\n　　　　　 http://dz.chineseembassy.org\r\n\r\n电子邮箱： chinaemb_dz@mfa.gov.cn'),(42,'大　　使： 郁序忠（Yu Xuzhong） \r\n\r\n地　　址： SUR LA PARCELLE 675 A VUGIZO BUJUMBURA BURUNDI \r\n\r\n信　　箱： B.P. 2550 BUJUMBUR A BURUNDI \r\n\r\n国家地区号：00257 \r\n\r\n电　　话： 22224307 \r\n\r\n传　　真： 22224082\r\n\r\n网　　址：http://bi.chineseembassy.org/\r\n\r\n电子邮箱：chinaemb_burundi@mfa.gov.cn（使馆）\r\n　　　　　CONEC@CBINF.COM　　　（经商处）'),(43,'大　　使： 赵亚力（Zhao Yali） \r\n\r\n地　　址： 37, MALCOLM X AVENUE, KOLOLO, KAMPALA, UGANDA \r\n\r\n信　　箱： P.O.BOX 4106, KAMPALA, UGANDA \r\n\r\n电　　话： 00256-41-4-259881（办公室）\r\n\r\n　　　　　 00256-41-4-236895（领事部）\r\n\r\n传　　真： 00256-41-