/*Table structure for table `tb_website_area` */

DROP TABLE IF EXISTS `tb_website_area`;

CREATE TABLE `tb_website_area` (
  `area_id` int(11) unsigned NOT NULL,
  `area_fatherId` int(11) NOT NULL DEFAULT '0' COMMENT '父亲ID',
