留学生联系祖国的桥梁。　　\r\n\r\n　　　　\r\n\r\n　　                                                        中华人民共和国驻新西兰、库克群岛、纽埃特命全权大使王鲁彤　',NULL,NULL,1397605061,'122.3.193.101',0,NULL),(51,'驻巴布亚新几内亚独立国大使馆\r\nEMBASSY OF THE PEOPLE\'S REPUBLIC OF CHINA IN PAPUA NEW GUINEA（供稿） （供稿） \r\n大　　使：仇伯华（Qiu Bohua） \r\n\r\n地　　址：SECTION 216 LOT 5, SIR JOHN GUISE DRIVE,WAIGANI, PORT MORESBY, PAPUA NEW GUINEA \r\n\r\n信　　箱：P.O.BOX 1351, BOROKO, PAPUA NEW GUINEA \r\n\r\n电　　话：00675-3259836, 6860166（手机）\r\n\r\n经 商 处：00675-3211116\r\n\r\n传　　真：00675-3258247 , 3254191\r\n\r\n网　　址：http://pg.china-embassy.org\r\n　　　　　http://pg.chineseembassy.org\r\n\r\n电子邮箱：chnempng@daltron.com.pg \r\n\r\n附件：',NULL,NULL,1397605061,'122.3.193.101',0,NULL),(52,'大　　使： 黄勇（Huang Yong） \r\n\r\n地　　址： 183 QUEEN ELIZABETH DRIVE SUVA，FIJI PRIVATE MAIL BAG，SUVA，FIJI\r\n\r\n国家地区号：00679 \r\n\r\n电　　话： \r\n\r\n　　　　　值班室：3300215 \r\n\r\n　　　　　办公室：3301833 \r\n\r\n　　　　　经商处：3304817 \r\n\r\n传　　真： 3300950 \r\n\r\n网　　址：http://fj.chineseembassy.org/chn/\r\n\r\n　　　　　http://fj.china-embassy.org/chn/\r\n\r\n电子邮箱： chinaemb_fj@mfa.gov.cn',NULL,NULL,1397605061,'122.3.193.101',0,NULL),(53,'    欢迎访问中国驻密克罗尼西亚联邦大使馆网站。\r\n\r\n    中密两国都是发展中国家。自1989年建交以来，两国在政治上互相尊重、平等相待，在经济上互相支持、共同发展，在地区和国际事务中密切沟通协调。双方高层及各级别交往频繁，经贸、农业、渔业、文化、教育等广泛领域的务实合作不断深化，两国友好合作关系前景广阔。\r\n\r\n    我们将竭诚为您服务，介绍有关中国政治、经济、文化、科技、侨务、教育及旅游等方面的信息，介绍中密友好合作关系的发展，大力促进两国人民的相互了解和交流，努力使我们的网站成为一座跨越时空、将两国人民紧密连接在一起的友谊桥梁，一个丰富知识、结交朋友的平台。\r\n\r\n    再次欢迎您的光临，感谢您的支持。\r\n\r\n \r\n\r\n中华人民共和国驻密克罗尼西亚联邦特命全权大使\r\n\r\n张连云',NULL,NULL,1397605061,'122.3.193.101',0,NULL),(54,'大使：马朝旭（Ma Zhaoxu）\r\n\r\n地址：15 Coronation Drive, Yarralumla, ACT 2600, AUSTRALIA\r\n\r\n国家地区号：0061－2\r\n\r\n电话：62734780\r\n\r\n传真：62735848\r\n\r\n网址：http://au.china-embassy.org\r\n　　　http://au.chineseembassy.org\r\n\r\n电子邮箱：chinaemb_au@mfa.gov.cn',NULL,NULL,1397605784,'122.3.193.101',0,NULL),(55,'    欢迎光临中华人民共和国驻委内瑞拉玻利瓦尔共和国大使馆网页。\r\n\r\n    在此，您可以获得有关中国外交政策、中委两国概况、双边关系、商贸往来、旅游文教、使馆工作、领事业务等方面的信息。\r\n\r\n    希望您和我们一道，为增进两国人民相互了解与友谊而共同努力。',NULL,NULL,1397606374,'122.3.193.101',0,NULL),(56,'    欢迎访问中华人民共和国驻乌拉圭东岸共和国大使馆网站。\r\n\r\n    中乌虽然相距遥远，但两国人民长期友好。自1988年建交以来，双边关系发展顺利。近年来，在两国政府的高度重视和大力推动下，双方高层交往频繁，经贸联系紧密，文教、科技、地方等领域交流丰富活跃，在国际和地区事务中保持良好沟通和配合，两国关系正大步迈向全面合作、互利共赢的新时期。\r\n\r\n    希望我们的网站成为您了解中国发展和中乌关系发展的窗口。我们也愿通过这一在线平台向您提供领事、经贸等服务信息。\r\n\r\n    感谢大家对中乌关系的关心和支持！期待着您经常访问我们的网站，并对使馆工作提出宝贵意见和建议。\r\n\r\n \r\n\r\n                                                                                                             中国驻乌拉圭大使 严邦华\r\n\r\n                                                                                                                     二〇一三年三月',NULL,NULL,1397606374,'122.3.193.101',0,NULL),(57,'    欢迎访问中华人民共和国驻智利共和国大使馆网站。\r\n\r\n    中国与智利虽相距遥远，但两国人民之间的传统友谊源远流长。智利是第一个同中国建交的南美国家。1970年12月15日中智建交以来，两国关系顺利发展。2012年6月，温家宝总理对智利进行了正式访问，两国建立了战略伙伴关系。双方在政治、经贸、人文等各领域友好合作不断取得新成果，中智关系进入全新的发展阶段。\r\n\r\n    我真诚希望通过网站这一交流平台，向中智各界朋友提供有关中国、中智关系发展状况以及使馆基本信息，及时提供有关新闻、领侨等服务，与各界友人保持沟通和交流，并听取各界对我馆工作的意见和建议，共同为加强中智战略伙伴关系发展，促进中智各领域互利合作，增进两国人民间友好情谊发挥积极作用。\r\n\r\n    中华人民共和国驻智利共和国特命全权大使\r\n\r\n    杨万明',NULL,NULL,1397606374,'122.3.193.101',0,NULL),(58,'    欢迎您访问中国驻圭亚那大使馆网站！　　\r\n    圭亚那地处南美大陆东北角，东邻苏里南，西接委内瑞拉、南抵巴西、北濒大西洋，是南美大陆唯一的英语国家。　　\r\n\r\n    中国同圭亚那虽然远隔重洋，但两国关系却源远流长。早在1853年，第一批华人就来到圭亚那，并在这里繁衍生息，与当地人和睦相处，成为圭六大民族之一。　　\r\n\r\n    1972年6月27日，圭亚那在英语加勒比国家中率先同中国建立外交关系。建交四十年来，中圭两国关系取得了长足的发展，政治互信不断加深，经贸合作持续拓展，卫生、教育、文化等领域的交流日趋频繁。我相信，在两国政府和人民的共同努力下，中圭传统友谊与互利合作必将不断取得新的成果。　　\r\n\r\n    驻圭亚那使馆网站作为我馆信息发布的窗口，让您在点击之间轻松了解有关动态。同时，它还是我们向您提供服务的平台，您可以方便地查阅有关办理护照、签证、公证、认证等信息。此外，网站还提供了一些有益的链接，为您了解中国、圭亚那以及中圭关系等情况提供便利。　　\r\n\r\n    希望您的每次访问都有所收获，同时也欢迎您对我馆的网站建设提出宝贵意见。\r\n\r\n \r\n\r\n\r\n                                         中国驻圭亚那合作共和国特命全权大使　 \r\n                            张利民\r\n                                二0一二年十二月六日',NULL,NULL,1397607454,'122.3.193.101',0,NULL),(59,'驻苏里南共和国大使馆\r\nEMBASSY OF THE PEOPLE\'S REPUBLIC OF CHINA IN THE REPUBLIC OF SURINAME（供稿） （供稿） \r\n大使：杨子刚（Yang Zigang） \r\n\r\n地址：ANTON DRAGTENWEG 154, P.O.BOX 3042, PARAMARIBO, SURINAME \r\n\r\n电话：00597-451570,00597-451210\r\n\r\n传真：00597-452540 \r\n\r\n网址：http://sr.china-embassy.org/\r\n　　　http://sr.chineseembassy.org/\r\n\r\n电子信箱： chinaemb_sr@mfa.gov.cn',NULL,NULL,1397607454,'122.3.193.101',0,NULL),(60,'欢迎您来到苏里南经商处网站并浏览相关信息。 \r\n苏里南位于南美洲东北部，西邻圭亚那，北临大西洋，东接法属圭亚那，南同巴西交界。 \r\n苏里南自然资源较丰富，主要有矿产、森林和渔业。矿产为铝土、石油、铁、锰、铜、镍、铂、黄金等。森林覆盖率达95%。 \r\n对外贸易在苏里南国民经济中占有十分重要的地位。近三年来，目前苏里南政局稳定，2010年新政府上台后，称重视建设融合多元化、创新以及现代民主政权的经济政治。 \r\n苏里南年进出口额均在20亿美元左右。中国是苏里南的主要贸易伙伴。 \r\n目前，中国与苏里南经济贸易合作持续增加。在苏里南投资的企业涉及木材、矿业、渔业和餐饮等越来越多的行业和领域。中苏经贸合作促进了两国友好和双边经济发展。 \r\n希望此网站是您了解苏里南经济的一个窗口，为企业及各界人士在与苏里南经贸往来中助一臂之力，促进中苏经贸合作，加深两国人民之间的友谊。 \r\n\r\n中国驻苏里南使馆经商参处参赞 马英莉',NULL,NULL,1397607454,'122.3.193.101',0,NULL),(61,'驻哥伦比亚共和国大使馆\r\nEMBASSY OF THE PEOPLE\'S REPUBLIC OF CHINA IN THE REPUBLIC OF COLOMBIA（供稿） （供稿） \r\n大　　使： 汪晓源（Wang Xiaoyuan） \r\n\r\n地　　址： CARRERA 16 NO.98-30, BOGOTA, COLOMBIA \r\n\r\n电子信箱： chinaemb_co@mfa.gov.cn \r\n\r\n国家地区号： 0057-1 \r\n\r\n总　　　机： 6223235 \r\n\r\n值　　　班：  6223202 \r\n\r\n办　公　室： 6223213 \r\n\r\n领　事　部： 6223126 \r\n\r\n武　官　处： 6223248 \r\n\r\n经　商　处： 6222879（兼传真） \r\n\r\n文　化　处： 6223228 \r\n\r\n传　　　真： 6223114\r\n\r\n网　　　址：http://co.china-embassy.org\r\n　　　　　　http://co.chineseembassy.org',NULL,NULL,1397607855,'122.3.193.101',0,NULL),(62,'    欢迎您访问中华人民共和国驻厄瓜多尔共和国大使馆网站！　　\r\n\r\n    中厄虽然相距遥远，但两国人民友谊源远流长。自1980年建交以来，双边关系发展顺利。特别是近年来，两国政治互信不断深化并在国际事务中保持密切沟通和协调，各领域务实合作成果丰硕，人文交流日益频繁，给两国人民带来了实实在在的利益。展望未来，中厄关系发展潜力巨大，前景广阔。　　\r\n\r\n    我们诚挚地希望本网站能成为您了解中厄关系的窗口，并为您提供经贸、领侨、文化、教育等各方面翔实、可靠的服务信息。　　\r\n\r\n    期待您经常访问我们的网站，并欢迎多提宝贵意见和建议。　　\r\n\r\n                                                                                                                                                                                                                         中华人民共和国驻厄瓜多尔共和国特命全权大使 王士雄',NULL,NULL,1397607855,'122.3.193.101',0,NULL),(63,'    欢迎访问中国驻秘鲁使馆网站！　　\r\n\r\n    中国是具有五千年历史的文明古国和最大的发展中国家。今天的中国正发生着日新月异的巨大变化，在国际事务中发挥着越来越重要的作用。中秘友谊源远流长。两国自1971年建交以来，特别是2008年建立战略伙伴关系以来，双边关系深入发展，各领域互利友好合作成果丰硕，两国人民之间的相互了解日益加深。实践证明，发展中秘友好关系符合两国和两国人民的利益。\r\n\r\n    本网站涵盖政治、经济、贸易、文化、领事等内容，并将不断获得丰富和完善，以期为大家提供更好的资讯和服务，成为您了解中国、中国驻秘鲁使馆的窗口和进一步密切中秘友好关系的桥梁。\r\n\r\n    期待您经常访问本网站！\r\n\r\n\r\n    中华人民共和国驻秘鲁共和国\r\n    特命全权大使 \r\n    黄敏慧',NULL,NULL,1397608073,'122.3.193.101',0,NULL),(64,'驻多民族玻利维亚国大使馆\r\nEMBASSY OF THE PEOPLE\'S REPUBLIC OF CHINA IN THE MULTINATIONAL STATES OF BOLIVIA（供稿） （供稿） \r\n大使： 李　东（Li Dong） \r\n\r\n地址： CALLE 1, NO.8532, LOS PINOS, CALACOTO LA PAZ, BOLIVIA \r\n\r\n信箱： CASILLA NO.10005, \r\n\r\n电子信箱： EMB-CHINA@KOLLA.NET \r\n\r\n国家地区号：00591-2 \r\n\r\n电话： \r\n\r\n值 班 室： 2793851 \r\n\r\n办 公 室： 2793851， 2792902 \r\n\r\n领 事 部（签证、侨务）： 2793851 \r\n\r\n武 官 处： 2793851 \r\n\r\n传真： 2797121 \r\n\r\n商 务 处 \r\n\r\n地址： CALLE H， NO.100, ACHUMANI, SECTORS SAN RAMON, LA PAZ, BOLIVIA \r\n\r\n电话： 2794567 \r\n\r\n传真： 2797577\r\n\r\n网址：http://bo.china-embassy.org\r\n　　　http://bo.chineseembassy.org',NULL,NULL,1397608073,'122.3.193.101',0,NULL),(65,'    欢迎您访问中华人民共和国驻阿根廷大使馆网站！感谢您对中国以及中国与阿根廷关系的关注。\r\n    中阿虽然相距遥远，但中阿人民友谊源远流长。目前双方处于相似的发展阶段，面临相同的发展任务，双方有着增进了解、加强合作的共同愿望。\r\n    自1972年建交以来，特别是2004年两国建立战略伙伴关系以来，两国政治交往日益密切，经济融合不断扩大，各领域合作呈现全面发展势头，两国人民间的相互了解和友谊不断加深。\r\n    中阿友好合作符合双方人民的根本利益。展望未来，中阿关系发展潜力巨大，前景广阔。中国愿与包括阿根廷在内的世界各国发展友好合作，推动建设持久和平、共同繁荣的和谐世界。\r\n    希望我们的网站能为您提供一个了解中国和中阿关系的窗口，架起一座连接中阿人民的友谊之桥。希望当您浏览本网站时，也能和我们一起见证和推动中阿战略伙伴关系的发展。\r\n    期待您经常访问我们的网站，并提出宝贵建议。\r\n\r\n\r\n\r\n　　　　 中国驻阿根廷特命全权大使 殷恒民',NULL,NULL,1397608260,'122.3.193.101',0,NULL),(66,'    欢迎您访问中国驻巴西大使馆网站！\r\n\r\n    中国和巴西分别是东西半球最大发展中国家，同为重要新兴大国。两国虽远隔重洋，但友谊源远流长。1974年，中巴建立外交关系。1993年，双方建立战略伙伴关系,2012年，提升为全面战略伙伴关系。近年来，两国高层交往频繁，政治互信不断深化，各领域务实合作成果丰硕，在国际事务中保持密切沟通与协调，给两国人民带来了实实在的利益，为促进世界和平与发展发挥着越来越重要的作用。\r\n\r\n    我们诚挚地希望本网站能成为一个窗口，让您通过它了解当代中国蓬勃发展的崭新面貌以及中巴关系深入发展的坚实步伐。\r\n\r\n    我们将努力为您提供经贸、领侨、文化、教育等各方面详实的服务信息，使本网站成为促进两国合作以及两国人民友谊的桥梁。\r\n\r\n    期待您经常来做客，欢迎您多提宝贵意见和建议，我们将竭诚为您服务。\r\n\r\n　　　　　　　　　　　　　　　　　　　　　　　　　\r\n\r\n　　　　　　　　　　　　　　　　　　　　　　 中华人民共和国驻巴西联邦共和国大使 李金章\r\n\r\n　　　　　　　　　　　　　　　　　　　　　　　　　　　　　 \r\n\r\n　　　　　　　　　　　　　　　　　　　　　　　            二〇一三年十二月',NULL,NULL,1397608260,'122.3.193.101',0,NULL),(67,'欢迎您访问中国驻特立尼达和多巴哥使馆网站,感谢您对中国和中特关系的关心。\r\n\r\n特立尼达和多巴哥是中国在加勒比海地区的老朋友，也是好朋友。两国人民的交往和友谊源远流长。1974年，中特两国建立大使级外交关系，开启了两国关系的新篇章。长期以来，中特两国相互支持，关系不断加深。近年来，双方高层往来更加密切，各领域合作成果丰硕，民间交往日益频繁，呈现出全方位、多层次发展的可喜局面。\r\n\r\n中国驻特立尼达和多巴哥使馆致力于增进两国之间的互利合作，愿为推进两国关系的进一步发展，为大家提供便捷高效的服务作出努力。真诚希望本网站成为特多朋友感知中国的窗口、旅特同胞联系祖国的纽带以及增进中特友好关系的桥梁。\r\n\r\n感谢您的访问，期待您再次光临。\r\n\r\n中国驻特立尼达和多巴哥使馆特命全权大使\r\n\r\n黄星原',NULL,NULL,1397610390,'122.3.193.101',0,NULL),(68,'欢迎访问中华人民共和国驻牙买加大使馆网站。\r\n牙买加是加勒比海上一颗璀璨的明珠，也是加勒比地区的重要国家。中国和牙买加虽远隔重洋，但两国人民的友好交往源远流长，已经持续了一个半世纪。建交以来，中牙关系保持良好发展势头，双方高层交往不断，各领域合作不断深化。两国关系正步入历史上的最佳发展时期。\r\n本网站将努力为朋友们提供详实的信息和竭诚的服务。希望本网站能成为朋友们了解中国和中牙关系的窗口，成为海外侨胞联系祖国的纽带，成为增进中牙友好关系的桥梁。\r\n    祝您访问愉快！欢迎您对我们的工作提出宝贵的意见和建议。\r\n \r\n \r\n                                                                 中国驻牙买加大使  董晓军',NULL,NULL,1397610390,'122.3.193.101',0,NULL),(69,'欢迎您访问中国驻美国大使馆网站。\r\n\r\n中国是世界上最大的发展中国家，美国是世界上最大的发达国家。一个稳定、不断发展的中美关系不仅符合两国和两国人民的根本利益，也有利于亚太地区乃至世界的和平与发展。\r\n\r\n中美建交30多年来，两国关系虽经历风雨，但取得了历史性的巨大发展。当前，两国正共同致力于建设相互尊重、互利共赢的合作伙伴关系，探索构建中美新型大国关系。中美关系正站在新的历史起点上，面临着进一步发展的重要机遇。\r\n\r\n中国驻美国大使馆以促进两国和两国人民之间的交往与合作，推动中美关系持续健康稳定发展为己任，愿本着这一宗旨，通过我们的网站向朋友们提供有益的信息和竭诚的服务，使之成为大家了解中国和中美关系的窗口，成为增进中美人民之间友谊的桥梁。\r\n\r\n感谢您的光临和对中美关系的关心，欢迎您多提宝贵意见和建议。',NULL,NULL,1397610811,'122.3.193.101',0,NULL),(70,'欢迎访问中华人民共和国驻墨西哥合众国大使馆网站！\r\n\r\n中国和墨西哥同为东西半球重要发展中国家和新兴大国。两国远隔重洋，但友谊源远流长。1972年，中墨建立外交关系。2003年，双方建立战略伙伴关系。2013年6月，习近平主席访墨期间，两国建立全面战略伙伴关系，标志着中墨关系进入全新的发展阶段。近年来，双方高层交往频繁，政治互信不断深化，各领域务实合作成果丰硕，在国际事务中保持密切沟通与协调，给两国人民带来了实实在在的利益，为促进世界和平与发展发挥着越来越重要的作用。\r\n\r\n我真诚希望通过我馆网站这一交流平台，向各界朋友介绍中国和中墨关系发展情况，努力为你提供经贸、领侨、文化等各方面信息和服务。希望网站能为加强中墨全面战略伙伴关系发展，促进各领域互利合作，增进两国人民间友好情谊发挥积极作用。\r\n\r\n中华人民共和国驻墨西哥合众国大使 邱小琪',NULL,NULL,1397610811,'122.3.193.101',0,NULL),(71,'各位朋友：\r\n\r\n欢迎访问中华人民共和国驻加拿大使馆网站！\r\n\r\n随着科学技术和经济全球化的快速发展，世界各国的相互联系越来越密切。各国人民相互学习、增进了解、加深友谊，变得更加重要。\r\n\r\n当今世界正处在大变革大调整之中。求和平、谋发展、促合作已经成为不可阻挡的时代潮流。中国的前途命运日益紧密地同世界的前途命运联系在一起。不管国际风云如何变幻，中国政府都将奉行独立自主的和平外交政策，维护世界和平、促进共同发展。\r\n\r\n中国和加拿大，一个是世界上面积最大的发展中国家，一个是世界上面积最大的发达国家，两国拥有广泛的共同利益和良好的合作基础。自1970年建交以来，双方交流领域不断拓宽，合作水平持续提高。\r\n\r\n中国大使馆愿借本网站，为大家提供有关中国对外政策、中加关系和双方在各领域的交流与合作以及领侨业务等方面的信息。希望有关信息有助各位更好地了解中国，并给各位提供便利。\r\n\r\n欢迎您经常访问并提出宝贵意见。谢谢！\r\n\r\n　　                                                               中华人民共和国驻加拿大特命全权大使\r\n\r\n　　                                                                章均赛',NULL,NULL,1397611282,'122.3.193.101',0,NULL),(72,'欢迎您访问中国驻古巴大使馆网站！\r\n\r\n古巴是西半球第一个与中国建交的国家。长期以来，两国友好合作关系不断巩固和发展。我们热切希望本网站能成为一个让您走近古巴、了解中国、认识中古关系的窗口。我们将努力为您提供各类信息服务。欢迎您对我馆网站建设提出宝贵意见和建议。\r\n\r\n期待您常来做客。\r\n\r\n　\r\n\r\n中华人民共和国驻古巴共和国大使  张 拓\r\n\r\n                                                                                             二〇一二年十二月',NULL,NULL,1397611282,'122.3.193.101',0,NULL),(73,'欢迎您来到中华人民共和国驻安提瓜和巴布达使馆网站。　　\r\n美丽的岛国安提瓜和巴布达，背靠加勒比海的湛蓝澄澈，面向大西洋的汹涌澎湃，这里有明媚动人的风景，也有热情好客的人民，这个国家在东加勒比国家组织中最早与中国建立外交关系，两国真挚的情谊深深扎根于每一个人的心中。我愿与各界朋友携手，增进中安友谊，推动两国交流合作，促进双边关系再上新台阶。　　\r\n希望本网站能引发您对中安关系的兴趣和关注，帮助您全面、及时了解中安双边关系动态。希望您能喜欢我们的网站，欢迎您对我们的工作提出宝贵的意见和建议。\r\n　　 \r\n　　\r\n中华人民共和国驻安提瓜和巴布达特命全权大使　　\r\n任共平',NULL,NULL,1397611392,'122.3.193.101',0,NULL),(74,'欢迎各位朋友访问中华人民共和国驻阿曼苏丹国大使馆网站！\r\n\r\n“乳香之国”阿曼位于阿拉伯半岛东南部，自然风光优美，文化底蕴深厚。古老的“海上丝绸之路”见证了中阿两国的世代友好关系。\r\n本站致力于向您介绍阿曼概况，中阿合作最新进展、领事业务及中国外交部官方发言等，希望对您有所帮助。\r\n最后，祝中国—阿曼两国人民友谊万古长青\r\n　　 \r\n　　 \r\n　　                                                                                                     中国驻阿曼大使\r\n　　                                                                                                            吴久洪',NULL,NULL,1397836600,'122.3.193.101',0,NULL),(75,'欢迎您访问中华人民共和国驻阿拉伯联合酋长国大使馆网站。\r\n\r\n中国和阿联酋的交往源远流长，1984年建交以来，双边关系取得了长足发展，特别是今年1月温家宝总理访阿期间，两国宣布建立战略伙伴关系，使中阿关系迈入了新的发展阶段。\r\n\r\n中国驻阿联酋大使馆一直致力于推动中阿关系各领域友好合作，努力促进两国人民间的相互了解和友谊。希望我们的网站成为您了解两国关系的窗口，成为联系两国人民的桥梁和促进中阿交流的平台。\r\n\r\n为您服务是我们的宗旨和目标，欢迎您经常访问本网站，对我们的工作提出宝贵建议。\r\n\r\n　　　　 \r\n\r\n　　                                                                                     黄杰民　　\r\n\r\n　　                                                                中华人民共和国驻阿拉伯联合酋长国　　\r\n\r\n　　                                                                                特命全权大使　　\r\n\r\n　                                                                             2012年5月于阿布扎比',NULL,NULL,1397836600,'122.3.193.101',0,NULL),(76,'欢迎您访问中国驻阿富汗大使馆网站，感谢您对中阿关系的兴趣和关注。\r\n中国与阿富汗毗邻而居。历史上，古“丝绸之路”将两国紧紧联系在一起。1955年，中阿建立外交关系。近年来，双方政治互信不断增强，各领域交流与合作日益深化，两国关系发展势头良好。我相信，在中阿两国政府和人民共同努力下，中阿关系必将迎来更加美好的明天。\r\n中国驻阿富汗大使馆致力于推动中阿战略合作伙伴关系深入发展，致力于深化两国人民传统友谊、促进互利合作，致力于为在阿的华侨华人、中资机构和留学生提供便捷、高效的领事服务。我真诚希望本网站能够成为阿富汗朋友感知中国的窗口，旅阿同胞联系祖国的纽带，以及中阿人民增进友谊的桥梁。\r\n祝您在我馆网站访问愉快，并欢迎您提出宝贵意见和建议。\r\n\r\n \r\n中华人民共和国驻阿富汗伊斯兰共和国\r\n特命全权大使\r\n邓锡军',NULL,NULL,1397836600,'122.3.193.101',0,NULL),(77,'欢迎您访问中国驻爱尔兰大使馆网站。\r\n\r\n爱尔兰风景秀丽，绿意盎然，享有“翡翠岛国”美誉。爱尔兰历史文化底蕴深厚，独特的音乐和舞蹈享誉全球。爱尔兰人民热情、勤奋并富有创新和进取精神。20与21世纪之交，爱尔兰创造了“凯尔特之虎”经济奇迹，欧债危机后，爱又成为欧元区首个退出救助的国家。\r\n\r\n近年来，中国爱尔兰两国友好关系蓬勃发展，双边交往日益紧密，各领域务实合作进一步深入和拓展，合作前景广阔。\r\n中国驻爱尔兰大使馆将致力于深化中爱政治互信，推进双方务实合作，增进两国人民了解和友谊，竭诚为广大旅爱侨胞、留学人员和访爱中国公民提供便捷、高效的领事服务。\r\n\r\n我衷心希望我们的网站成为大家了解中国和中爱关系的窗口，架起中爱两国人民友谊的桥梁。欢迎您提出意见和建议，期待您再次光临。　　　　 \r\n\r\n　　                                                                                                         中华人民共和国驻爱尔兰特命全权大使  徐建国　　\r\n\r\n　　                                                                                                                           2014年3月20日　　',NULL,NULL,1397837595,'122.3.193.101',0,NULL),(78,'大使：曲喆（Qu Zhe） \r\n\r\n地址：NARVA MNT.98, 15009 TALLINN, ESTONIA \r\n\r\n国家地区号：00372 \r\n\r\n总 机：6015830、6015831 \r\n\r\n传 真：6015833 \r\n\r\n网址： http://www.chinaembassy.ee \r\nhttp://ee.chineseembassy.org\r\nhttp://ee.china-embassy.org \r\n\r\n电子邮箱： CHINAEMB@ONLINE.EE\r\n\r\n经 商 处 \r\n\r\n地 址：JUHKENTALI 21，10144 TALLINN，ESTONIA \r\n\r\n电 话：6607867、6607868 \r\n\r\n传 真：6607818',NULL,NULL,1397837595,'122.3.193.101',0,NULL),(79,'欢迎各位朋友访问中国驻阿尔巴尼亚大使馆网站！\r\n\r\n中国是世界上最古老的文明之一，幅员辽阔，人口众多。新中国建立特别是改革开放以来，古老的东方文明再一次焕发出青春活力，中国在全球政治、经济、文化中的重要地位与日俱增。\r\n\r\n“山鹰之国”阿尔巴尼亚历史绵长、地接东西，气候宜人，风景美丽，拥有千岩万壑的山峦地貌和澄净碧蓝的大海岬湾。近年来，阿国社会趋于稳定，国民经济持续增长，投资环境不断改善，2011年更被Lonely Planet旅行指南评为“2011年全球最具吸引力十大旅游目的地国”之一。\r\n\r\n“海内存知己，天涯若比邻”。阿尔巴尼亚1949年即与中国建交，60多年来双边友好合作关系不断发展，两国人民友谊不断加深。近年来，两国在政治、经贸、文教等各领域的交流合作都取得丰硕成果。\r\n\r\n使馆网站将致力于通过虚拟空间的信息发布和互动服务，向阿国民众展示一个客观、真实的中国，向中国民众展示一个充满机遇的阿尔巴尼亚。希望这个网站，能够为中阿两国人民之间构筑一座跨越时空的电子桥梁。\r\n\r\n预祝朋友们访问愉快，并欢迎您对本网站提出宝贵意见和建议。\r\n\r\n \r\n 中华人民共和国驻阿尔巴尼亚共和国特命全权大使\r\n  叶  皓',NULL,NULL,1397837595,'122.3.193.101',0,NULL),(80,'中国驻保加利亚大使馆现位于索非亚市亚历山大·冯·洪堡大街7号（STR. ALEXANDER VON HUMBOLDT 7, SOFIA 1113, REPUBLIC OF BULGARIA），距市中心约10分钟车程。使馆周边为城市居民住宅。全馆包括院落占地面积2000多平方米。办公楼租自保加利亚境内外交财产署（ADIS），建筑面积约2000平方米，建筑年代为上世纪70年代。',NULL,NULL,1397838362,'122.3.193.101',0,NULL),(81,'大使：崔启明（Cui Qiming）  \r\n\r\n地址：22, BERESTYANSKAYA STR., MINSK, THE REPUBLIC OF BELARUS, 220071 \r\n\r\n邮编：220071 \r\n\r\n国家地区号：00375-17 \r\n\r\n办公室电话：2849728 \r\n\r\n传真：2853681 \r\n\r\n网址：http://by.chineseembassy.org\r\n\r\n邮箱：chinaemb_by@mfa.gov.cn',NULL,NULL,1397838362,'122.3.193.101',0,NULL),(82,'各位朋友：\r\n\r\n时隔二十年回到美丽的维也纳常驻，出任第11任中国驻奥地利大使，我感到十分高兴和荣幸。我热忱欢迎您访问我馆网站，感谢您对中国和中奥关系的兴趣和关注。\r\n\r\n中国的和平发展举世瞩目，中奥友好合作日益扩大和深入，前景十分广阔。我们将通过中文和德文及时向您提供有关中国的发展、对外政策以及中奥关系的信息。您在这里也可以找到有关旅游、留学和领侨业务等方面的须知。我相信，您可以通过我们的网站更多地了解中国和中奥关系。\r\n\r\n祝您访问愉快，欢迎您提出意见和建议！\r\n\r\n中华人民共和国驻奥地利共和国特命全权大使 \r\n赵彬',NULL,NULL,1397838362,'122.3.193.101',0,NULL),(83,'欢迎您访问中国驻冰岛大使馆网站。中冰两国虽然相距遥远，但两国人民相互理解，友谊深厚，友好合作关系不断巩固和发展。近年来，在双方共同努力下，中冰关系进入了新的历史时期，面临全新的发展局面。双方应携手努力，抓住机遇，推动两国友好不断迈上新的台阶，造福两国人民。真诚希望您通过访问使馆网站获得所需信息，为推动中冰两国相互理解和友好合作关系作出积极贡献。欢迎对我们的工作提出宝贵的意见和建议。\r\n \r\n马继生\r\n \r\n中国驻冰岛大使',NULL,NULL,1397839532,'122.3.193.101',0,NULL),(84,'欢迎访问中国驻波兰大使馆网站，感谢您对中国和中波关系的兴趣和关注。\r\n　\r\n中波两国和两国人民之间的友谊源远流长。60多年来，虽然国际风云变幻，两国始终相互尊重、平等相待，互利合作不断取得新成果，中波友好深入人心。\r\n\r\n2004年中波建立友好合作伙伴关系后，两国高层交往日益增多，各领域合作与交流不断扩大。2011年底，波兰总统科莫罗夫斯基访华，中波将双边关系提升至战略伙伴关系水平,波成为首个与中国建立战略伙伴关系的欧盟新成员国，两国关系掀开了新的一页。2012年4月，中国国务院总理温家宝对波兰的访问，对全面深化两国战略伙伴关系、开拓各领域务实合作起到了巨大的推动作用。 \r\n\r\n中国的和平发展令世人瞩目，中波友好合作也在不断扩大和深化。中国驻波兰大使馆将继续积极致力于推动两国关系发展，加强各领域交流与合作，增进两国人民相互了解和友谊，并为旅波华侨华人、中资机构和企业以及留学生等提供及时的资讯与帮助。在我们的网站上，您可以及时追踪中波关系发展的重大事件，实时了解最新的商业信息、经济资讯，充分领略两国文化交流的精彩瞬间，更能轻松找到教育留学、领事服务等方面详尽、实用的办事指南。\r\n　\r\n衷心希望本网站可以成为您了解中国和中波关系的窗口，成为为您服务的平台，更成为两国人民深入交流、增进友谊的桥梁。　　\r\n\r\n欢迎对我馆工作和网站建设提出宝贵的意见和建议。　　\r\n　　　　\r\n　　　　\r\n　　　　\r\n徐坚\r\n中国驻波兰大使\r\n2012年9月于华沙',NULL,NULL,1397839532,'122.3.193.101',0,NULL),(85,'亲爱的网友，欢迎您访问中华人民共和国驻比利时王国大使馆网站！\r\n\r\n中国和比利时同为亚欧两大洲两个古老而又年轻的国家。1949年中华人民共和国成立，焕发了5000年中华文明的勃勃生机。比利时立国180多年，历经沧桑，公元前的凯尔特人和罗马帝国都在这里留下印记。\r\n\r\n1971年，中华人民共和国同比利时王国建交，两国关系开启了新篇章，两国人民从17世纪以来的友好交往得到延承。40年来，中比关系发展顺利，近年又取得重要成就。2005年，阿尔贝二世国王访华进一步加深了两国的交往与合作。2009年和2010年，习近平副主席和温家宝总理先后成功访比，将中比关系提高到新水平。中比双边贸易额从建交初期的2000多万美元发展到2010年的221亿美元，增长了1000多倍。两国合作从蹒跚起步，发展到覆盖经贸、科技、教育、人文、友好省州等各领域。\r\n\r\n我们的网站宛如一本翻开的书页。左边是温和友善、灵活务实的比利时；右边是勤劳智慧，崇尚和平的中国。\r\n\r\n我们的网站恰似一扇落地的双视窗。左边是比利时，秀美的自然风光，清新的原生态，现代的科技和繁荣的工业文明，高耸的哥特式建筑，令人触动；右边是中国，960万平方公里，辽阔的高原连着山脉，无边的海洋并着川流湖泊，水墨山水的江南园林遥望鳞次栉比的现代高楼，5000年的古老文明和21世纪的东方活力，令人神往。\r\n\r\n我们的网站是您手中鼠标的左右键。左边点开的是比利时，欧洲文艺复兴和工业革命的发祥地之一，“丁丁”、“蓝精灵”的故里，巧克力浓郁，啤酒飘香，钻石璀璨。右键点开的是中国，东方华夏文明的摇篮，造纸术、指南针、火药、活字印刷术等四大发明的诞生地，孔子儒学、孙子兵法全球享誉，中国功夫独步天下，中华美食诱惑难挡。\r\n\r\n我们深知，如果一个国家的政治、经济、文化能够对其他国家产生吸引力，得到认同，那么两国人民之间就会多一些情谊，国家之间就会多一份理解，多一些合作。在这里，我们期待为您打开一扇了解中国和比利时的大门，架设一座加强沟通和联系的桥梁，搭建一个促进交流与合作的平台。\r\n\r\n“群贤毕至，长少咸集”，感谢各位关注我们的网站，也期待通过您的关注和督促，我们不断改进工作，更好地为大家服务。祝您访问愉快！',NULL,NULL,1397839532,'122.3.193.101',0,NULL),(86,'欢迎访问中华人民共和国驻芬兰共和国使馆网站！\r\n\r\n中芬两国虽然相距遥远，但一贯保持全面友好的合作关系。历史见证了中芬日新月异的发展，也见证了两国之间愈久弥新的传统友谊。近年来，双边关系快速发展，两国高层互访频繁，务实合作亮点频现，人民之间的友谊不断加深。相信在双方共同努力和各界朋友的关心支持下，中芬关系的明天必将更加美好！\r\n\r\n中国驻芬兰使馆网站向您介绍中国的政治、经济、外交和中芬关系的概况与要闻，并提供经商、领侨、留学和旅游等各方面的信息与服务。希望我们的网站拉近彼此之间的距离，打开一扇了解中国的窗口。企盼老朋友常来做客，新朋友与日俱增。\r\n\r\n欢迎您对本网站提出有益建议。\r\n\r\n \r\n\r\n \r\n\r\n中国驻芬兰大使  于庆泰',NULL,NULL,1397844855,'122.3.193.101',0,NULL),(87,'欢迎访问中华人民共和国驻法国使馆网站！\r\n\r\n法国是安理会常任理事国，有着灿烂的历史文化，先进的工业科技基础，是西方文明的代表之一。\r\n\r\n法国是最早同中国建交的西方大国，从1964年两国建交至今，双方关系不断发展，日益成熟，展示了战略性、全球性和时代性。当前中法各领域合作和人文交流蓬勃发展，不断造福于两国人民。\r\n\r\n中国驻法国使馆肩负着促进中法关系的重任，愿汇中法各界之智之力，共同推动双方合作再上新台阶。我们希望通过使馆网站提供中法关系的最新信息，反映中法合作的生动全貌，为同胞们提供服务和便利，也向法国各界朋友展现多彩和谐的中国、蓬勃发展的中国、开放合作的中国。希望这个网站成为中法交流的窗口。\r\n\r\n欢迎、期待大家的积极参与和支持！\r\n\r\n中华人民共和国驻法国特命全权大使\r\n\r\n翟隽\r\n\r\n二〇一四年一月六日',NULL,NULL,1397844855,'122.3.193.101',0,NULL),(88,'欢迎访问中华人民共和国驻俄罗斯联邦大使馆网站，感谢您对中国和中俄关系的关注。　　\r\n\r\n中俄互为最大邻国，有着长达4300多公里的共同边界线和悠久的友好交往史。中华人民共和国成立以来，两国关系经历了各种复杂的考验，在双方的共同努力下，中俄之间正逐步形成全方位、多层次、高质量的合作格局。当前两国关系处于历史最好时期。双方高层互访频繁，政治和战略互信不断增强，各领域务实合作日益扩大，人文合作和民间交流持续深入。中俄关系的全面、健康、稳定发展，有力地促进了两国共同振兴，造福两国和两国人民，更好地推动了世界多极化和国际关系民主化进程，为建设持久和平、共同繁荣的和谐世界做出了重要贡献。　　\r\n\r\n中华人民共和国驻俄罗斯联邦大使馆致力于推动中俄战略协作伙伴关系发展，深化两国各领域交流与合作，增进两国人民之间的相互了解和友谊，并竭诚为广大旅俄华侨华人、留学生提供咨询和帮助。　　\r\n\r\n衷心希望本网站成为网友了解中国和中俄关系的窗口，并成为大家开展交流与合作的平台。欢迎对我馆工作和本网站建设提出宝贵的意见和建议。',NULL,NULL,1397844855,'122.3.193.101',0,NULL),(89,'欢迎访问新改版的中国驻德国大使馆网站，感谢各位朋友对中国和中德关系的关心。　　\r\n\r\n中德都是世界上和各自地区有着重要影响的国家。建交40多年来，中德友好关系和务实合作稳定健康发展，达到前所未有的广度和深度。　　\r\n\r\n经过全新改版的使馆网站将努力全面、客观地介绍中国，及时为您提供有关中德关系的最新资讯。希望它不仅成为你了解中国和中德关系的窗口，同时也是一个竭诚为你服务的平台。欢迎大家经常来这里看看并多提宝贵意见和建议！　　\r\n\r\n　　 \r\n史明德\r\n\r\n中华人民共和国驻德意志联邦共和国特命全权大使\r\n\r\n2014年2月8日于柏林',NULL,NULL,1397844855,'122.3.193.101',0,NULL),(90,'热烈欢迎各位朋友访问中国驻丹麦大使馆网站！\r\n\r\n中国和丹麦虽然相距遥远，但两国传统友谊深厚。建交60多年来，中丹关系稳步前行，各领域交流合作成果显著。当前，中丹关系面临着进一步深入发展的重要机遇。中国驻丹麦大使馆将积极致力于推动中丹关系持续健康发展，不断增进两国人民的相互了解和交流合作，并竭诚为各界人士提供丰富资讯和优质服务。\r\n\r\n愿使馆网站能成为大家全面感知中国的窗口、旅丹侨胞联系祖国的纽带及深化中丹传统友谊的桥梁。衷心感谢各位对发展中丹关系的大力支持和帮助，热忱欢迎大家对使馆网站多提宝贵意见和建议！ \r\n\r\n　　                                                                                                  \r\n\r\n中华人民共和国驻丹麦王国特命全权大使\r\n\r\n刘 碧 伟',NULL,NULL,1397844855,'122.3.193.101',0,NULL),(91,'欢迎访问中华人民共和国驻波斯尼亚和黑塞哥维那大使馆网站！\r\n\r\n中国同波黑虽然相距遥远，但两国和两国人民间传统友谊深厚。自1995年4月3日建交来，中波双边关系发展顺利,两国在政治、经济、文化等各领域合作不断扩大，双方在国际及多边事务中合作良好。中方重视中波关系，愿同波方一道，推动双边关系及各领域合作向更高水平发展。\r\n\r\n希望我馆网站能为中波两国各界人士提供一个了解中国、波黑及中波关系发展的平台。\r\n\r\n欢迎您提供宝贵意见和建议，我们将不断改进工作，竭诚为您服务！\r\n\r\n预祝您在本网站访问愉快！\r\n\r\n \r\n\r\n中华人民共和国驻波斯尼亚和黑塞哥维那\r\n\r\n特命全权大使\r\n\r\n董春风',NULL,NULL,1397844855,'122.3.193.101',0,NULL),(92,'欢迎您访问中国驻格林纳达使馆网站。\r\n\r\n格林纳达位于加勒比海向风群岛最南端，是世界第二大肉豆蔻生产国，产量占全球需求量四分之一，有“香料之国”的美誉。格风景秀丽，以阳光、海水、沙滩及热带风情闻名，是著名的渡假胜地。1498年，哥伦布发现这个美丽的地方。由于格主岛形似石榴，因此被西班牙水手称为“Granada”（石榴），与其故乡某处同名。曾先后